import React from "react";
import "./BodyTabs.css"

const BodyTabs = () => {
    return (
        <div className="body-tabs">

                <li>All</li>
                <li>Food</li>
                <li>Drinks</li>
                <li>Snacks</li>
                <li>Packages</li>

        </div>
    )
}

export default BodyTabs
